import styled from '@emotion/styled';
import { Container, IconButton, InputAdornment, OutlinedInput, Paper, Stack, Typography } from '@mui/material';
import React from 'react';
import WalletPrev from '../Assests/walletprev.webp';
import TextField from '@mui/material/TextField';
import { Visibility, VisibilityOff } from '@mui/icons-material';

const LoginWrap = styled(Paper)(({ theme }) => ({
    borderRadius: 15,
    width: '100%',
    maxWidth: 700,
    display: 'flex',
    alignItems: 'center',
    padding: 20,
    justifyContent: 'center',
    flexDirection: 'column',
    flexWrap: 'nowrap'
}))
export default function Login() {
    const [showPassword, setShowPassword] = React.useState(false);

    const handleClickShowPassword = () => setShowPassword((show) => !show);

    const handleMouseDownPassword = (event) => {
        event.preventDefault();
    };

    return (
        <Container sx={{
            height: '70vh',
            display: 'flex',
            justifyContent: 'center',
            alignItems: 'center'
        }} fixed>
            <LoginWrap elevation={24}>
                <img src={WalletPrev} alt='Wallet' width='80%' />
                <Stack sx={{ width: '100%', maxWidth: '564px' }} mt={3}>
                    <Typography fontWeight={600}>Username</Typography>
                    <TextField
                        id="outlined-multiline-flexible"
                        multiline
                        maxRows={4}
                        sx={{
                            marginTop: 1,
                            marginBottom: 2
                        }}
                    />
                    <Typography fontWeight={600}>Password</Typography>
                    <OutlinedInput
                        id="outlined-adornment-password"
                        type={showPassword ? 'text' : 'password'}
                        endAdornment={
                            <InputAdornment position="end">
                                <IconButton
                                    aria-label="toggle password visibility"
                                    onClick={handleClickShowPassword}
                                    onMouseDown={handleMouseDownPassword}
                                    edge="end"
                                >
                                    {showPassword ? <VisibilityOff /> : <Visibility />}
                                </IconButton>
                            </InputAdornment>
                        }
                    />
                    <Button fontWeight={700} sx={{
                backgroundColor: '#ff4848',
                height: '50px',
                borderRadius: 2,
                textTransform: 'none',
                fontSize: 18,
                marginTop: 3,
                marginBottom: 3,
                '&: hover': {
                    backgroundColor: '#9d0000'
                }
            }} variant="contained" endIcon={<Upload />}>
                Upload Assest
            </Button>
                </Stack>
            </LoginWrap>
        </Container>
    )
}
